import React, { Component } from 'react';
import Moment from 'react-moment';
import 'moment-timezone';


class Announce_post extends Component {
    render() { 
        return (  
    <tr>
        <td> <img src={this.props.post.img} width='30px' height='30px'  /> {this.props.post.name}</td>
        <td><Moment format='YYYY/MM/DD HH:mm'>{this.props.post.date}</Moment></td>
        <td><button className="btn btn-info">Edit</button></td>
        <td><button className="btn btn-info">Delete</button></td>
        
    </tr>    
        );
    }
}
 
export default Announce_post;
